        //calc(distance, 6.42*Math.pow(10, 7), 700000, 1.50*Math.pow(10, 8), albedo, 5.6704*Math.pow(10,-8));
    }
    public static void calc(double SBC, double sunrad, double distance, double sunpow, double albedo){
        double Sp=(sunpow * 4*Math.PI*Math.pow(sunrad,2))/ (4*Math.PI*Math.pow(distance*1.50*Math.pow(10, 8),2));
