        System.out.println("average photon flux SAve = " + (int)Math.rint(Save));
        System.out.println("including albedo SAve x (1 - alpha) = " + (int)Math.rint(Savealpha));
        System.out.println("temperature TP (K) = " + (int)Math.rint(tempK));
        System.out.println("temperature TP (C) = " + (int)Math.rint(tempC));
    }
}

