        System.out.println("(Power in) = (Power out), predict temperature of Planet.");
        System.out.print("Planet: ");
        String x = scanner.nextLine();
        System.out.print("distance of Planet from Sun (AU): ");
        double b = scanner.nextDouble();
        System.out.print("radius of Planet (km): ");
        double c = scanner.nextDouble();
        System.out.print("albedo of Planet: ");
        double a = scanner.nextDouble();
        PeebTwo(b, 6.42*Math.pow(10, 7), 1.50*Math.pow(10, 8), a);
    }
    public static void PeebTwo(double d, double Ss, double AU, double al){
        double stefan=5.67*Math.pow(10,-8);
        double a=4*Math.PI*Math.pow(d*AU,2);
        double z=(Ss) * 4*Math.PI*Math.pow(700000,2);
        double b=Math.round((z/a)/4 * (1-al));
        double x=Math.round(z/a);
        double c=Math.pow((int)b/(stefan),0.25);
        System.out.println("photon flux SP = " + Math.round(x));
        System.out.println("average photon flux SAve = " + Math.round(x/4));
        System.out.println("including albedo SAve x (1 - alpha) = " + Math.round(b));
        System.out.println("temperature TP (K) = " + (int)Math.rint(c));
        System.out.println("temperature TP (C) = " + (int)Math.floor(c-273));
    }
}

