function watchPage() {
    function watchVideo(i) {
        new Promise(function(resolve) {
            let a = $("tbody tr").filter(function() {
                return $(this).find("path").attr("d") === "M5.555 3.17l6 4a1 1 0 0 1 0 1.664l-6 4A1 1 0 0 1 4 12.002v-8a1 1 0 0 1 1.555-.832z";
            }).map(function() {
                return $(this).find("span").filter(function() {
                    return $(this).text() === "Start"
                });

            });
            a.eq(i)[0].click();
            let t = setTimeout(resolve, 15 * 60 * 1000);
            setTimeout(function() {
                if (!$("path[d=\"M18,6 L6,18\"]").length) {
                    clearTimeout(t);
                    resolve();
                }
            }, 10000);
        }).then(function() {
            $("path[d=\"M18,6 L6,18\"]").parent().parent().parent().click();
            let a = $("tbody tr").filter(function() {
                return $(this).find("path").attr("d") === "M5.555 3.17l6 4a1 1 0 0 1 0 1.664l-6 4A1 1 0 0 1 4 12.002v-8a1 1 0 0 1 1.555-.832z";
            }).map(function() {
                return $(this).find("span").filter(function() {
                    return $(this).text() === "Start"
                });
            });
            if (++i < a.length) {
                setTimeout(() => watchVideo(i), 10000);
            } else {
                $("button[aria-label=\"See next assignments page\"]").click()
                setTimeout(watchPage, 10000);
            }
        });
    }
    watchVideo(0);
}
watchPage();```

